function App() {
  return (
    <div className="App">
      <NavBar1></NavBar1>
      <TopSlider></TopSlider>
      <div className='backgprime'>Hello world</div>
      <Routes>
      {/* <Route path='/' element={<Landing/>} /> */}
      </Routes>
    </div>
  );
}

export default App;
